import React, { Component } from 'react'
import { FaUserPlus } from 'react-icons/fa'

export default class Register extends Component {
    render() {
        return (
            <div>
            <form>
                <h3 className = 'font-weight-normal' style = {{textAlign: 'center'}}>Create an account</h3>
                <input className = 'form-control' type = 'text' placeholder = 'Username' required autoFocus/>
                <input className = 'form-control' type = 'password' placeholder = 'Password' required/>
                <input className = 'form-control' type = 'password' placeholder = 'Confirm Password' required/>
                <button className = 'btn btn-primary btn-block'type = 'submit' ><FaUserPlus/> Register</button>
            </form>        
            </div>
        )
    }
}
